docs/more/environments.html.body:
Environments
clea serve and clea build commands allows you to use the --target=environment option to specify the configuration file to be used.
By default, the development environment is used (config.dev.json).
The mapping used to determine which environment file is used can be found in .clea-cli.json:
"environmentSource": "config/config.json",
"environments": {
  "development": "config/config.dev.json",
  "production": "config/config.prod.json"
}

The source environment will always be merged with the selected environment.

Disclaimer
The path to the environment file should be relative to the root (configurable in .clea-cli.json) folder of your project

Access it
To access the environment configuration in your application, just inject the CONFIG constant:
export class AppController {

  constructor (
    private ENVIRONMENT,
    private CONFIG,
  ) {
    console.log(this.ENVIRONMENT, this.CONFIG);
  }

}

The ENVIRONMENT constant will show you the current environment name.
New
You can create new environment files by doing the following:

create a src/config/config.NAME.json
add { "NAME": "config/config.NAME.json" } in .clea-cli.json
use it with --target=NAME option

docs/more/lazy-loading.html.body:
Lazy loading
By default, lazy-loading is activated with ocLazyLoad library.
Example
To help you with the integration process, we made the following option:
clea generate module lazy --lazy-load

It will generate a new module called lazy and lazy-load it in the closest routing file.
With the above example, the following structure will be generated:
├── lazy/
│    |──  lazy.module.ts
│    └──  lazy.component.ts
│
└── app.routing.ts
In app.route.ts, the new module will be automatically referenced:
export class AppRoutes {

  constructor ($stateProvider: ng.ui.IStateProvider) {
    'ngInject';

    $stateProvider.state('lazy', {
      url: '/lazy',
      component: 'lazy',
      resolve: {
        module: ['$q', '$ocLazyLoad', ($q: ng.IQService, $ocLazyLoad: oc.ILazyLoad) => {
          return $q ((resolve) => {
            ( require).ensure([], () => {
              let { LazyModule } = require('./lazy/lazy.module');

              $ocLazyLoad.load({
                name : LazyModule,
                files: undefined
              });

              resolve(module);
            });
          });
        }]
      }
    });

  }
}

And that's it, you can now acces the /lazy URL which will lazy-load the new LazyModule.
Build
At build time, you should see a new chunk for each lazy-loaded module:
